import React from 'react'

 function Contacts ({contacts,onRemoveContact}){
    return(
        <div>
            <ul>
                {contacts.map(contact=>(
                    <li key={contact.id}>
                        {contact.name} {contact.number}
                        <button onClick={onRemoveContact}> 
                            Delete
                        </button>
                    </li>
                ))}
            </ul>                
        </div>
 )
}

export default Contacts;
